CREATE TABLE `pais` (
  `NOME_PAIS` varchar(35) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `ABREVIACAO_PAIS` char(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `POPULACAO` int(11) DEFAULT NULL,
  `PIB_PERCAPITA` float DEFAULT NULL,
  `BANDEIRA` blob,
  PRIMARY KEY (`ABREVIACAO_PAIS`)
) ENGINE=InnoDB DEFAULT CHARSET=latin2 COLLATE=latin2_bin;

CREATE TABLE `olimpiada` (
  `ANO` int(4) NOT NULL,
  `SEDE` varchar(255) DEFAULT NULL,
  `TIPO` varchar(6) NOT NULL,
  PRIMARY KEY (`ANO`,`TIPO`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;

CREATE TABLE `esporte` (
  `NOME_ESPORTE` varchar(255) NOT NULL,
  `MODALIDADE` varchar(255) NOT NULL,
  `TIPO_LOCAL` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`NOME_ESPORTE`,`MODALIDADE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;


CREATE TABLE `atleta` (
  `NOME` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `GENERO` char(5) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `PAIS_ORIGEM` char(3) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `TECNICO` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `PREPARADOR_FISICO` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  PRIMARY KEY (`NOME`,`PAIS_ORIGEM`),
  KEY `atleta_ibfk_1` (`PAIS_ORIGEM`),
  CONSTRAINT `atleta_ibfk_1` FOREIGN KEY (`PAIS_ORIGEM`) REFERENCES `pais` (`abreviacao_pais`)
) ENGINE=InnoDB DEFAULT CHARSET=latin2 COLLATE=latin2_bin ;

CREATE TABLE `atletaesporte` (
  `NOME_ATLETA` varchar(255) NOT NULL DEFAULT 'blk',
  `NOME_ESPORTE` varchar(255) NOT NULL DEFAULT 'blk',
  `MODALIDADE` varchar(255) NOT NULL DEFAULT 'blk',
  `ANO_CONQUISTA` int(4) NOT NULL,
  `MEDALHA` varchar(6) DEFAULT NULL,
  PRIMARY KEY (`NOME_ATLETA`,`NOME_ESPORTE`,`MODALIDADE`,`ANO_CONQUISTA`),
  KEY `NOME_ESPORTE` (`NOME_ESPORTE`,`MODALIDADE`),
  CONSTRAINT `atletaesporte_ibfk_1` FOREIGN KEY (`NOME_ATLETA`) REFERENCES `atleta` (`nome`),
  CONSTRAINT `atletaesporte_ibfk_2` FOREIGN KEY (`NOME_ESPORTE`, `MODALIDADE`) REFERENCES `esporte` (`nome_esporte`, `modalidade`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;

CREATE TABLE `participa` (
  `TIPO_OLIMP` varchar(6) NOT NULL DEFAULT 'blk',
  `ANO_OLIMP` int(4) NOT NULL,
  `NOME_ESPORTE` varchar(255) NOT NULL DEFAULT 'blk',
  `MODALIDADE` varchar(255) NOT NULL DEFAULT 'blk',
  PRIMARY KEY (`TIPO_OLIMP`,`ANO_OLIMP`,`NOME_ESPORTE`,`MODALIDADE`),
  KEY `NOME_ESPORTE` (`NOME_ESPORTE`,`MODALIDADE`),
  KEY `ANO_OLIMP` (`ANO_OLIMP`,`TIPO_OLIMP`),
  CONSTRAINT `participa_ibfk_1` FOREIGN KEY (`NOME_ESPORTE`, `MODALIDADE`) REFERENCES `esporte` (`nome_esporte`, `modalidade`),
  CONSTRAINT `participa_ibfk_2` FOREIGN KEY (`ANO_OLIMP`, `TIPO_OLIMP`) REFERENCES `olimpiada` (`ano`, `tipo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;

CREATE TABLE `sede` (
  `ANO_OLIMP` int(4) NOT NULL,
  `TIPO_OLIMP` varchar(6) NOT NULL,
  `PAIS_SEDE` char(3) NOT NULL DEFAULT 'blk',
  PRIMARY KEY (`ANO_OLIMP`,`PAIS_SEDE`,`TIPO_OLIMP`),
  KEY `PAIS_SEDE` (`PAIS_SEDE`),
  KEY `ANO_OLIMP` (`ANO_OLIMP`,`TIPO_OLIMP`),
  CONSTRAINT `sede_ibfk_1` FOREIGN KEY (`PAIS_SEDE`) REFERENCES `pais` (`abreviacao_pais`),
  CONSTRAINT `sede_ibfk_2` FOREIGN KEY (`ANO_OLIMP`, `TIPO_OLIMP`) REFERENCES `olimpiada` (`ano`, `tipo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;

CREATE TABLE `mascote` (
  `ANO_OLIMP_MASCOTE` int(4) NOT NULL,
  `TIPO_OLIMP_MASCOTE` varchar(6) NOT NULL,
  `MASCOTES` blob,
  PRIMARY KEY (`ANO_OLIMP_MASCOTE`,`TIPO_OLIMP_MASCOTE`),
  CONSTRAINT `mascote_ibfk_1` FOREIGN KEY (`ANO_OLIMP_MASCOTE`, `TIPO_OLIMP_MASCOTE`) REFERENCES `olimpiada` (`ano`, `tipo`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ;



 
 





  
  
  
  



  



  


